import React from "react";
import { createDrawerNavigator, DrawerContentScrollView, DrawerItem, DrawerItemList } from "@react-navigation/drawer";
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { ScrollView, Text, View,Image } from "react-native";

import Inicio from "../Inicio";
import Login from "../Login";
import Cadastrar from "../Cadastrar";
import Dashboard from "../Dashboard";
import ConsultarCliente from "../ConsultarCliente"



const Stack = createNativeStackNavigator();


const Drawer = createDrawerNavigator();

function CustomDrawerContent(props) {
    return (
        <DrawerContentScrollView {...props} contentContainerStyle={{flex: 1, borderWidth: 1}}>
            <View style={{ padding: 20, backgroundColor: "red" }} >
                <Text style={styles.text}>Projeto</Text>
                <Image style={styles.Image} source={require("../../../assets/TPC.jpg")} />
            </View>

            <ScrollView style={{ flex: 1 }}>
                <DrawerItemList {...props} />
            </ScrollView>

            <View style={{ padding: 20, backgroundColor: "red" }}>
                <Text>sair</Text>
            </View>
        </DrawerContentScrollView>

    );
}
export function DrawerNav(){
        return (
            <Drawer.Navigator
            drawerContent={CustomDrawerContent}>
            <Drawer.Screen name="Dashboard" component={Dashboard} />
            <Drawer.Screen name="ConsultarCliente" component={ConsultarCliente} />
        </Drawer.Navigator>

        )
    }



export default function Routes() {

    return (
        <Stack.Navigator>
            <Stack.Screen name="Inicio" component={Inicio} />
            <Stack.Screen name="Login" component={Login} />
            <Stack.Screen name="Cadastrar" component={Cadastrar} />
            <Stack.Screen name="DrawerNav" component={DrawerNav} options={{ headerShown: false}} />
       </Stack.Navigator>

    )
}
const styles=styles.create({
    container:{
      flex:1,   
    },
    text:{
        
    }

    
})
